// src/App.js
import React from 'react';
import Login from './Login';
import Register from './Register';
import './App.css'; // Import your CSS file here for styling

const App = () => {
  return (
    <div className="app">
      <h1>Tiffin Connect</h1>
      <Login />
      <Register />
    </div>
  );
};

export default App;
